INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 3001100, 1, 2.1, "ヤマト", 2, "2030/01/01 14:59:59", 0.0, 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 100, -416.5, 130011);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 3001101, 4, 5.68, "ヤマト", 2, "2030/01/01 14:59:59", 0.0, 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 101, -416.5, 130011);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 3001102, 1, 0.0, "ヤマト", 1, "2030/01/01 14:59:59", 0.0, 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 102, -416.5, 130011);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 3002100, 1, 0.0, "フブキ", 1, "2030/01/01 14:59:59", 0.0, 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 100, -416.5, 130211);
