INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 3002103, 7, 5.67, "フブキ", 1, "2030/01/01 14:59:59", 0.0, 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 103, -416.5, 130211);
